import React, { useState } from 'react';

const Home = () => {
  const [searchTerm, setSearchTerm] = useState('');
  const [result, setResult] = useState([]);

  const handleSearch = async (e) => {
    e.preventDefault();

    if (searchTerm.trim() === '') {
      alert("Please enter a stock to search");
      return;
    }

    try {
      const res = await fetch('http://localhost:3001/companies/search', {
        method: 'POST',
        headers: {
          'Content-Type': 'application/json',
        },
        body: JSON.stringify({ name: searchTerm }),
      });

      const data = await res.json();

      if (res.ok) {
        setResult(data);
      } else {
        setResult([]);
        alert(data.message || "No companies found");
      }

    } catch (error) {
      console.error('‚ùå Search failed:', error);
    }

    setSearchTerm('');
  };

  return (
    <div className="min-h-screen bg-slate-100 dark:bg-gray-900 text-gray-900 dark:text-white px-6 py-10">
      <div className="max-w-5xl mx-auto text-center">
        <div className="flex justify-center items-center text-5xl text-blue-700 font-bold mb-4">
          <img
            className="h-20 w-auto mx-3 border rounded-3xl"
            src="/Finoro logo.png"
            alt="logo"
          />
          FINORO
        </div>
        <h1 className="text-xl font-serif mb-6">
          Stock analysis and screening tool for investors in India.
        </h1>

        {/* Search form */}
        <form onSubmit={handleSearch} className="flex justify-center gap-3 mb-8">
          <input
            className="w-4/5 sm:w-2/3 h-12 px-4 border border-cyan-600 rounded-3xl text-center"
            type="text"
            placeholder="Search for a stock..."
            value={searchTerm}
            onChange={(e) => setSearchTerm(e.target.value)}
          />
          <button
            type="submit"
            className="px-4 py-2 bg-blue-600 text-white rounded-3xl hover:bg-blue-700"
          >
            Search
          </button>
        </form>

        {/* Results table */}
        {result.length > 0 && (
          <div className="overflow-x-auto mt-6">
            <h2 className="text-2xl font-semibold mb-4">Search Results</h2>
            <table className="min-w-full border border-gray-300 dark:border-gray-700 text-sm">
              <thead className="bg-gray-200 dark:bg-gray-800">
                <tr>
                  {Object.keys(result[0]).map((key) => (
                    <th key={key} className="px-4 py-2 border capitalize">{key}</th>
                  ))}
                </tr>
              </thead>
              <tbody>
                {result.map((company, index) => (
                  <tr key={index} className="hover:bg-gray-100 dark:hover:bg-gray-700 text-center">
                    {Object.values(company).map((value, i) => (
                      <td key={i} className="px-4 py-2 border">{value}</td>
                    ))}
                  </tr>
                ))}
              </tbody>
            </table>
          </div>
        )}

        <h1 className="mt-10 text-lg">Or Analyze....</h1>
      </div>
    </div>
  );
};

export default Home;

